import React from 'react';
import './header.css';
import Emblem from '../../../media/emblem-img.png';
import {Container, Row, Col, Image} from 'react-bootstrap';
import {Codesandbox} from 'react-feather'

function header() {
    return (
        <header className = "header d-flex align-items-center justify-content-center" id = "home">
            <Container>
                <Row>
                    <Col className = "d-flex justify-content-center">
                        <Codesandbox className = "emblem-icon" size = {150}></Codesandbox>
                        <Image src = {Emblem}></Image>
                    </Col>
                </Row>   
            </Container>
            <div class="container">
  <svg viewBox="0 0 500 500" preserveAspectRatio="xMinYMin meet">
    <path d="M0,100 C150,200 350,0 500,100 L500,00 L0,0 Z" style="stroke: none; fill:red;"></path>
  </svg>
</div>
        </header>
    )
}

export default header
